Members_Trend.query:
Members = load "${App.Datasets.LoyaltyMemberTier7.FullyQualifiedName}";
Members = group Members by ('LoyaltyProgramMember_EnrollmentDate_Year', 'LoyaltyProgramMember_EnrollmentDate_Month', 'LoyaltyProgramMember_EnrollmentDate_Day');
Members = foreach Members generate Members.'LoyaltyProgramMember_EnrollmentDate_Year' as 'Year', Members.'LoyaltyProgramMember_EnrollmentDate_Month' as 'Month', Members.'LoyaltyProgramMember_EnrollmentDate_Day' as 'Day', sum(unique(Members.'LoyaltyMemberId')) over ([..0] partition by all order by ('LoyaltyProgramMember_EnrollmentDate_Year','LoyaltyProgramMember_EnrollmentDate_Month','LoyaltyProgramMember_EnrollmentDate_Month')) as 'Total_Members';
Members = filter Members by {{row(ActivityDate_1.selection, [0], ["min", "max"]).asDateRange("date('Year','Month','Day')")}};
Transactions = load "${App.Datasets.TransactionJournal7.FullyQualifiedName}";
Transactions = filter Transactions by 'JournalType_Name' in ["Accrual", "Redemption"] && 'Status' == "Processed";
Transactions = filter Transactions by {{row(ActivityDate_1.selection, [0], ["min", "max"]).asDateRange("date('ActivityDate_Year', 'ActivityDate_Month', 'ActivityDate_Day')")}};

result = group Members by ('Year', 'Month') full, Transactions by ('ActivityDate_Year', 'ActivityDate_Month') ;
result = foreach result generate coalesce(Members.'Year' ,Transactions.'ActivityDate_Year') as 'Year', coalesce(Members.'Month', Transactions.'ActivityDate_Month') as 'Month', last(Members.'Total_Members') as 'Total_Members', unique(Transactions.'MemberId') as 'Members_with_one_or_more_transactions';
result = fill result by (dateCols=('Year','Month', "Y-M"));
result = timeseries result generate 'Total_Members' as 'Predicted_Members', 'Members_with_one_or_more_transactions' as 'Precited_Members_with_one_or_more_transactions' with (length=1, dateCols=('Year','Month',"Y-M"));
result = foreach result generate 'Year'+"~~~"+'Month' as 'LoyaltyProgramMember_EnrollmentDate_Year~~~LoyaltyProgramMember_EnrollmentDate_Month', coalesce('Total_Members','Predicted_Members') as 'Total_Members', coalesce('Members_with_one_or_more_transactions', 'Precited_Members_with_one_or_more_transactions') as 'Members_with_one_or_more_transactions';
result = order result by ('LoyaltyProgramMember_EnrollmentDate_Year~~~LoyaltyProgramMember_EnrollmentDate_Month' asc);
result = limit result 2000;

