Members_by_Enrollmen_1.query:
q = load "${App.Datasets.LoyaltyMemberTier7.FullyQualifiedName}";
q_A = filter q by date('LoyaltyProgramMember_EnrollmentDate_Year', 'LoyaltyProgramMember_EnrollmentDate_Month', 'LoyaltyProgramMember_EnrollmentDate_Day') in ["current month".."current day"];
q_B = filter q by date('LoyaltyProgramMember_EnrollmentDate_Year', 'LoyaltyProgramMember_EnrollmentDate_Month', 
'LoyaltyProgramMember_EnrollmentDate_Day') in ["1 month ago".."current day - 1 month"];
result = group q_A by 'LoyaltyProgramMember_EnrollmentChannel' full, q_B by 'LoyaltyProgramMember_EnrollmentChannel';
result = foreach result generate coalesce(q_A.'LoyaltyProgramMember_EnrollmentChannel', q_B.'LoyaltyProgramMember_EnrollmentChannel') as 'LoyaltyProgramMember_EnrollmentChannel', unique(q_A.'LoyaltyMemberId') as 'Members_CMTD', unique(q_B.'LoyaltyMemberId') as 'Members_PMTD', unique(q_A.'LoyaltyMemberId') / sum(unique(q_A.'LoyaltyMemberId')) over ([..] partition by all) as 'Members_Percentage_CMTD', unique(q_B.'LoyaltyMemberId') / sum(unique(q_B.'LoyaltyMemberId')) over ([..] partition by all) as 'Members_Percentage_PMTD' ;
result = foreach result generate 'LoyaltyProgramMember_EnrollmentChannel', 'Members_Percentage_CMTD', 'Members_Percentage_PMTD', coalesce((Members_Percentage_CMTD - Members_Percentage_PMTD) / Members_Percentage_PMTD,0) as 'Members_Change_Percentage_CMTD';
result = order result by ('Members_Percentage_CMTD' desc nulls last);
result = limit result 1;

